objetoCompra:
Café em pó homogêneo, torrado e moído, do tipo Superior, de primeira qualidade, embalados em pacotes de 500g ou 250g, com as seguintes características:
· Espécie: café 100% arábica
· Embalagem: tipo alto vácuo ou vácuo puro, em pacotes com 500 ou 250 gramas;
· Validade: não inferior a 12 meses;
· Torração: Médio claro a moderadamente escuro;
· Moagem: média ou fina;
· Característica Sensorial: Qualidade Global (QG): igual ou superior a 6,0 pontos;
Nota final: categoria SUPERIOR.

